color_t apa102_color(unsigned int a, unsigned char b, unsigned char g, unsigned char r)
{
    // blue is the LSB
//  printf("%x\n", a<<24 | b<<16 | g<<8 | r);
    return a<<24 | b<<16 | g<<8 | r;

}

color_t invert(unsigned int num) {

unsigned int b0 = (num & 0x000000ff) << 24u;
unsigned int b1 = (num & 0x0000ff00) << 8u;
unsigned int b2 = (num & 0x00ff0000) >> 8u;
unsigned int b3 = (num & 0xff000000) >> 24u;

unsigned int res = b0 | b1 | b2 | b3;
return res;

}

